	
	function LocationPicker(provice,city,area,hidProviceId,hidCityId,hidAreaId)//城市对象
	{
		this.selProvice=document.getElementById(provice);
		this.selCity=document.getElementById(city);
		this.selArea=document.getElementById(area);
		this.hidProvice=document.getElementById(hidProviceId);
		this.hidCity=document.getElementById(hidCityId);
		this.hidArea=document.getElementById(hidAreaId);
		init(this);
	}
	
	LocationPicker.prototype.fillProvice=function()//填充省份信息
	{
		//var sel=document.getElementById(this.formArray[0]);
		if(this.selProvice!=null)
		{
		    var curArr=D0;
		    this.fillSel(this.selProvice,curArr);
		    this.fillCity();
		    this.fillArea();
		}
	}
	LocationPicker.prototype.fillSel=function(sel,arr)//填充指定的选择框
	{
		sel.options.length=0;
		for(var i=0;i<arr.length;i++)
		{
			eval("sel.options[i]=new Option" + arr[i]);
		}
		if(arr.length>0)
		{
			sel.selectedIndex=0;
		}
	}
	LocationPicker.prototype.fillCity=function()//填充城市信息
	{
		if(this.selCity!=null)
		{
		    var priId=this.selProvice.selectedIndex;
		    //var sel=document.getElementById(this.formArray[1]);
		    var curArr=eval("D1_"+priId);
		    this.fillSel(this.selCity,curArr);
		    this.fillArea();
		}
	}
	
	LocationPicker.prototype.fillArea=function()//填充区域信息
	{
	    if(this.selArea!=null)
	    {
		    var priId=this.selProvice.selectedIndex;
		    var cityId=this.selCity.selectedIndex;
		    //var sel=document.getElementById(this.formArray[2]);
		    var curArr=eval("D2_"+priId+"_"+cityId);
		    this.fillSel(this.selArea,curArr);
		}
	}
	
	
	
	function initValue(objLocation)//初始化表单值
	{
	    var isContinue=true;
	    if(isContinue&&objLocation.selProvice!=null)
        {
            isContinue=false;
            objLocation.fillProvice();
            if(objLocation.hidProvice!=null&&objLocation.hidProvice.value!="" && objLocation.hidProvice.value!=null)
            {
                objLocation.selProvice.value=objLocation.hidProvice.value;
                
                isContinue=true;
            }
        }
        
        if(isContinue &&  objLocation.selCity!=null)
        {
            isContinue=false;
            objLocation.fillCity();
            if(objLocation.hidCity!=null &&objLocation.hidCity.value!="" && objLocation.hidCity.value!=null)
            {
                objLocation.selCity.value=objLocation.hidCity.value;
                isContinue=true;
            }
        }
        if(isContinue &&  objLocation.selArea!=null)
        {
            isContinue=false;
            objLocation.fillArea();
            if(objLocation.hidArea!=null &&objLocation.hidArea.value!="" && objLocation.hidArea.value!=null)
            {
                objLocation.selArea.value=objLocation.hidArea.value;
                isContinue=true;
            }
        }
	}
	
	
	
	function init(objLocation)//初始化表单
	{
		initValue(objLocation);
		if(objLocation.selProvice!=null)
		{
		    objLocation.selProvice.onchange=function()
		    {
		        if(objLocation.hidProvice!=null)
		        {
		            objLocation.hidProvice.value=objLocation.selProvice.value;
		            objLocation.hidCity.value="";
		            objLocation.hidArea.value="";
		        }
			    objLocation.fillCity();
		    }
		}
		
		if(objLocation.selCity!=null)
		{
		    objLocation.selCity.onchange=function()
		    {
		        if(objLocation.hidCity!=null)
		        {
		            objLocation.hidCity.value=objLocation.selCity.value;
		            objLocation.hidArea.value="";
		        }
			    objLocation.fillArea();
		    }
		}
		if(objLocation.selArea!=null)
		{
		    objLocation.selArea.onchange=function()
		    {
			    if(objLocation.hidArea!=null)
		        {
		            objLocation.hidArea.value=objLocation.selArea.value;
		        }
		    }
		}
	}

